	module.exports = "<h2 id=\"api-communication\">API Communication</h2>\n<p>To send requests to the server, inject the Api service to your component.\nThe Api service is a wrapper around the Angular 2 Http Client which handles\nsome of the lower level things that you shouldn&#39;t have to deal with. It\nalso integrates into Lumen&#39;s API.</p>\n<hr>\n<h3 id=\"api-response-structure\">API Response Structure</h3>\n<p>The Api service expects <em>all</em> responses in the form of <code>{data: content}</code> instead of just <code>content</code>.</p>\n<pre><code>// Correct response structure:\n{\n    data: [\n        {name: &#39;John&#39;, email: &#39;john@example.com&#39;},\n        {name: &#39;Jane&#39;, email: &#39;jane@example.com&#39;},\n    ]\n}\n\n// Incorrect response structure\n[\n    {name: &#39;John&#39;, email: &#39;john@example.com&#39;},\n    {name: &#39;Jane&#39;, email: &#39;jane@example.com&#39;},\n]\n</code></pre><hr>\n<h3 id=\"get\">GET</h3>\n<pre><code>let options = {search: {name: &#39;john&#39;}};\n\nthis.api.get(&#39;users&#39;, options).subscribe(\n    (response) =&gt; {\n        this.users = response.users;\n    },\n    (error) =&gt; console.error(error)\n);\n</code></pre><blockquote>\n<p><strong>Note</strong>: You must call <code>.subscribe()</code> for the request to be sent.</p>\n</blockquote>\n<hr>\n<h3 id=\"post-patch-put\">POST/PATCH/PUT</h3>\n<p>All three method calls take the same arguments.</p>\n<pre><code>let data = {email: &#39;john@example.com&#39;, password: &#39;password&#39;};\n\nthis.api.post(&#39;users&#39;, data).subscribe(\n    (response) =&gt; console.log(response),\n    (error) =&gt; console.error(error)\n);\n</code></pre><hr>\n<h3 id=\"delete\">DELETE</h3>\n<pre><code>this.api.delete(&#39;users/1&#39;).subscribe(\n    (response) =&gt; console.log(response),\n    (error) =&gt; console.error(error)\n)\n</code></pre>";

